class Solution:
    def validSubstringCount(self, s: str, word2: str) -> int:
        cnt = Counter(word2)
        l = r = 0

        ncnt = Counter()
        cur = 0

        ans = 0

        n = len(s)
        while l < n:
            while r < n and cur < len(cnt):
                if s[r] in cnt:
                    ncnt[s[r]] += 1
                    if ncnt[s[r]] == cnt[s[r]]:
                        cur += 1
                r += 1

            if cur < len(cnt): break
            ans += n - r + 1

            if s[l] in cnt:
                if ncnt[s[l]] == cnt[s[l]]:
                    cur -= 1
                ncnt[s[l]] -= 1
            l += 1
        return ans

