class Solution {
public:
    long long minNumberOfSeconds(int h, std::vector<int>& t) {
        long long l = 1, r = 1e18; 
        while (l < r) {
            long long mid = l + (r - l) / 2; 
            long long tt = 0;
            for (int time : t) {
                tt += 1ll* (sqrt(1 + 1ll * 8 * mid / time) - 1) / 2;
                if (tt >= h) break;
            }
            if (tt >= h) r = mid;
            else l = mid + 1; 
        }

        return l; 
    }
};

