        long long st = 1, ed = 10000000000000000LL, mid, res = 0, now, i, j, x;
        while (st <= ed){
            mid = (st + ed) / 2;
            now = H;
            for (auto q : a){
                if (q > mid) continue;
                x = (sqrt(1 + 8 * mid / q) - 1) / 2;
                now -= x;
                if (now <= 0) break;
            }

            if (now <= 0){
                res = mid;
                ed = mid - 1;
            }
            else st = mid + 1;
        }

        return res;
    }
};

