        auto helper=[=](long long sum) -> int
        {
            long long ans = 0;
            for (long long start = 0, end = 1e9, mid; start <= end;)
            {
                mid = (start + end) / 2;
                if (mid * (mid + 1) / 2 <= sum)
                {
                    ans= mid;
                    start = mid + 1;
                }
                else
                {
                    end = mid - 1;
                }
            }
            return ans;
        };
        for (long long start = 0, end = 1e18, mid; start <= end;)
        {
            mid = (start + end) / 2;
            long long sum = 0;
            for (auto &i : workerTimes)
            {
                sum += helper(mid / i);
            }
            if (sum >= mountainHeight)
            {
                ans = mid;
                end = mid - 1;
            }
            else
            {
                start = mid + 1;
            }
        }
