class Solution {
public:
    int minValidStrings(vector<string>& words, string target) {
        int n=target.size();
        vector <int> len(n,0);
        for (string i:words){
            string s=i; s+='#'; s+=target;
            int m=s.size();
            vector <int> z(m);
            int l=0,r=0;
            for (int i=1; i<m; i++){
                if (i<r) z[i]=min(r-i,z[i-l]);
                while (i+z[i]<m&&s[z[i]]==s[i+z[i]]) z[i]++;
                if (i+z[i]>r){
                    l=i;
                    r=i+z[i];
                }
            }
            int sz=i.size();
            for (int j=0; j<n; j++) len[j]=max(len[j],z[j+sz+1]); 
        }
        multiset <int> ms;
        target=" "+target;
        int dp[n+1];
        dp[0]=0;
        for (int i=1; i<=n; i++) dp[i]=1e9;
        vector <int> done[n+1];
        for (int i=1; i<=n; i++){
            for (int j:done[i]) ms.erase(ms.find(j));
            if (len[i-1]){
                ms.insert(dp[i-1]+1);
                if (i+len[i-1]<=n) done[i+len[i-1]].push_back(dp[i-1]+1);
            }
            if (!ms.empty()) dp[i]=*ms.begin();
        }
        if (dp[n]>=1e8) dp[n]=-1;
        return dp[n];
    }
};

