using namespace std;
class Solution {
public:
    int minValidStrings(vector<string>& words, string target) {
        int n = target.length();
        vector<vector<int>> ranges(n + 1);
        for (string &str : words) {
            int m = str.length();
            vector<int> kmp(m);
            kmp[0] = 0;
            int ptr = 0;
            for (int i = 1; i < m; i++) {
                while (true) {
                    if (str[i] == str[ptr]) {
                        kmp[i] = ++ptr;
                        break;
                    } else {
                        if (ptr == 0) {
                            kmp[i] = 0; break;
                        }
                        ptr = kmp[ptr - 1];
                    }
                }
            }
            ptr = 0;
            for (int i = 0; i < n; i++) {
                while (ptr > 0 && target[i] != str[ptr]) {
                    ptr = kmp[ptr - 1];
                }
                if (target[i] == str[ptr]) ptr++;
                if (ptr > 0) ranges[i + 1].pb((i + 1) - ptr);
            }
        }
        const int MAX = 1e9;
        vector<int> dp(n + 1, MAX);
        dp[0] = 0;
        for (int i = 1; i <= n; i++) {
            for (int &cur : ranges[i]) {
                dp[i] = min(dp[i], dp[cur] + 1);
            }
        }
        return (dp[n] == MAX ? -1 : dp[n]);
    }
};

class Solution {
public:
    vector<int> getSneakyNumbers(vector<int>& nums) {
        map<int, int> mp;
        for (int x : nums) mp[x]++;
        vector<int> ans;
        for (pair<int, int> cur : mp) {
            if (cur.second == 2) ans.push_back(cur.first);
        }
        return ans;
    }
};

