vector<int> zalgo(const string& s) {
	// Maintain max r such that there is l <= i <= r with [l,r] being prefix substring
	int n = s.size(), l = 0, r = 0;
	vector<int> z(n);
	z[0] = n;
	for (int i = 1; i < n; ++i) {
		if (i > r) {
			l = r = i;
			while (r < n && s[r - l] == s[r]) ++r;
			z[i] = r - l;
			--r;
		} else {
			if (z[i - l] <= r - i) z[i] = z[i - l];
			else {
				l = i;
				while (r < n && s[r - l] == s[r]) ++r;
				z[i] = r - l;
				--r;
			}
		}
	}
	return z;
}
