            L[i].erase(L[i].begin(), L[i].begin() + words[i].size() + 1);
        }
        int m = target.size();
        const int INF = 1e9;
        vector<int> dp(m, INF);
        Fenwick<Min> fenw(m + 1);
        fenw.update(m, 0);
        for (int i = m - 1; i >= 0; --i) {
            for (int j = 0; j < n; ++j) {
                int lcp = L[j][i];
                int mn = fenw.query(i + lcp).x;
                if (mn != INT_MAX) dp[i] = min(dp[i], mn + 1);
            }
            fenw.update(i, dp[i]);
        }
        return dp[0] > m ? -1 : dp[0];
    }
};

