    long long validSubstringCount(string word1, string word2) {
        int n = word1.size();
        int m = word2.size();

        if (m > n) return 0;

        vector<int> cnt(26);

        for (auto ch : word2) cnt[ch - 'a']++;

        int pt = 0;
        long long res = 0;

        auto trial = [&]() {
            for (int i = 0; i < 26; i++) if (cnt[i] > 0) {
                return false;
            }

            return true;
        };

        for (int i = 0; i < n; i++) {
            while (pt < n && !trial()) {
                cnt[word1[pt++] - 'a']--;
            }

            if (pt == n && !trial()) break;
            res += n - pt + 1;

            cnt[word1[i] - 'a']++;
        }

        return res;
    }
};

