class Solution {
public:
    long long validSubstringCount(string word1, string word2) {
        vector<int> need(26, 0), have(26, 0);
        int required_chars = 0;
        int matched_chars = 0;  

        for (char c : word2) {
            if (need[c - 'a'] == 0) {
                required_chars++;
            }
            need[c - 'a']++;
        }

        int left = 0;
        long long total = 0;
        int N = word1.size();

        for (int right = 0; right < N; ++right) {
            int c = word1[right] - 'a';
            have[c]++;
            if (have[c] == need[c]) {
                matched_chars++;
            }

            while (left <= right && have[word1[left] - 'a'] > need[word1[left] - 'a']) {
                have[word1[left] - 'a']--;
                left++;
            }

            if (matched_chars == required_chars) {
                total += left + 1;
            }
        }

        return total;
    }
};

class Solution {
public:
    long long validSubstringCount(string word1, string word2) {
        int n = word1.size();
        int required_counts[26] = {0};
        for (char c : word2) {
            required_counts[c - 'a']++;
        }

        vector<int> letters;
        for (int c = 0; c < 26; ++c) {
            if (required_counts[c] > 0) {
                letters.push_back(c);
            }
        }
        vector<int> counts[26]; 
        vector<vector<int>> positions_c[26]; 

        for (int c : letters) {
            counts[c] = vector<int>(n + 1, 0);
            for (int pos = 1; pos <= n; ++pos) {
                counts[c][pos] = counts[c][pos - 1] + (word1[pos - 1] - 'a' == c ? 1 : 0);
            }

            int max_count = counts[c][n];
            positions_c[c] = vector<vector<int>>(max_count + 1);
            for (int pos = 0; pos <= n; ++pos) {
                int k = counts[c][pos];
                positions_c[c][k].push_back(pos);
            }
        }

        long long total = 0;

        for (int i = 1; i <= n; ++i) {
            int pos_max = -1;
            bool valid = true;

            for (int c : letters) {
                int counts_c_i_minus_1 = counts[c][i - 1];
                int K = counts_c_i_minus_1 + required_counts[c];

                if (K > counts[c][n]) {
                    valid = false;
                    break;
                }

                auto& positions = positions_c[c][K];
                auto it = lower_bound(positions.begin(), positions.end(), i);
                if (it == positions.end()) {
                    valid = false;
                    break;
                }
                int pos_c = *it;
                pos_max = max(pos_max, pos_c);
            }

            if (valid && pos_max <= n) {
                total += n - pos_max + 1;
            }
        }

        return total;
    }
};

class Solution {
public:
    long long minNumberOfSeconds(int H, vector<int>& a) {
        long long st = 1, ed = 10000000000000000LL, mid, res = 0, now, i, j, x;
        while (st <= ed){
            mid = (st + ed) / 2;
            now = H;
            for (auto q : a){
                if (q > mid) continue;
                x = (sqrt(1 + 8 * mid / q) - 1) / 2;
                now -= x;
                if (now <= 0) break;
            }

            if (now <= 0){
                res = mid;
                ed = mid - 1;
            }
            else st = mid + 1;
        }

        return res;
    }
};

