        int yao[26], now[26], C = 0, i, j = -1, n = a.size();
        char c;
        for (i = 0; i < 26; ++i) yao[i] = now[i] = 0;
        for (auto qc : b) ++yao[qc - 'a'];
        for (i = 0; i < 26; ++i)
            if (yao[i] == 0) ++C;

