        auto getMaxX = [&](long long C) -> long long {
            long long Left = 0, Right = H;
            while (Left <= Right) {
                long long Mid = (Left + Right) / 2;
                long long val = Mid * Mid + Mid;
                if (val <= C) {
                    Left = Mid + 1;
                } else {
                    Right = Mid - 1;
                }
            }
            return Right;
        };

        while (Left < Right) {
            long long Mid = (Left + Right) / 2;
            long long total_x = 0;
            for (int i = 0; i < n; ++i) {
                long long w = wTimes[i];
                long long C = (2 * Mid) / w;
                long long x = getMaxX(C);
                total_x += x;
            }
            if (total_x >= H) {
                Right = Mid;
            } else {
                Left = Mid + 1;
            }
        }
        return Left;
    }
};

class Solution {
public:
    bool reportSpam(vector<string>& message, vector<string>& bannedWords) {
        unordered_set<string> bannedSet(bannedWords.begin(), bannedWords.end());
        int count = 0;
        for (const string& word : message) {
