    long long minNumberOfSeconds(int mountainHeight, vector<int>& workerTimes) {
        priority_queue<P, vector<P>, greater<P>> pq;

        int n = workerTimes.size();

        vector<long long> vec(n);
        vector<long long> cnt(n);

        for (int i = 0; i < n; i++) {
            vec[i] = workerTimes[i];
