            pq.emplace(workerTimes[i], i);
        }

        long long res = 0;
        cout << endl;
        while (mountainHeight > 0) {
            auto [cost, id] = pq.top(); pq.pop();
            res = max(res, cost);
            cnt[id]++;
            vec[id] += cnt[id] * workerTimes[id];
            pq.emplace(vec[id], id);
            mountainHeight--;
        }

        return res;
    }
};

