class Solution:
    def minNumberOfSeconds(self, mountainHeight: int, workerTimes: List[int]) -> int:
        def check(T):
            total = 0
            for wt in workerTimes:
                S = (2 * T) // wt
                D = 1 + 4 * S
                if D < 0:
                    xi = 0
                else:
                    sqrt_D = int(D**0.5)
                    xi = (-1 + sqrt_D) // 2
                    while (xi + 1) * xi > S:
                        xi -= 1
                    while (xi + 1) * xi <= S:
                        xi += 1
                    xi -=1
                    xi = max(xi, 0)
                total += xi
            return total >= mountainHeight

        left, right = 0, 1 << 60
        while left < right:
            mid = (left + right) // 2
            if check(mid):
                right = mid
            else:
                left = mid + 1
        return left

