class Solution {
    long long cnt(long long x)
    {
        long long low=0ll;
        long long high=1e9;
        long long ans=low;
        while(low<=high)
        {
            long long mid=(low+high)/2;
            if((mid*mid+mid)/2ll <= x)
            {
                ans=mid;
                low=mid+1;
            }
            else
                high=mid-1;
        }
        return ans;
    }
public:
    long long minNumberOfSeconds(int mountainHeight, vector<int>& workerTimes) {
        long long x=mountainHeight;
        x=(x*x+x)/2ll;
        long long maxTime=*std::min_element(workerTimes.begin(),workerTimes.end());
        maxTime=maxTime*x;

        long long low=1;
        long long high=maxTime;
        long long ans=high;
        while(low<=high)
        {
            long long mid=(low+high)/2;

            long long red=0ll;
            for(auto time : workerTimes)
                red=red+cnt(mid/time);

            if(red>=mountainHeight)
            {
                ans=mid;
                high=mid-1;
            }
            else
                low=mid+1;
        }
        return ans;
    }
};

