class Solution:
    def validSubstringCount(self, word1: str, word2: str) -> int:
        target = Counter(word2)
        current = Counter()
        count, left = 0, 0

        # Using sliding window
        for right in range(len(word1)):
            current[word1[right]] += 1

            while all(current[char] >= target[char] for char in target):
                count += len(word1) - right
                current[word1[left]] -= 1
                left += 1

        return count

class Solution:
    def minNumberOfSeconds(self, mountainHeight: int, workerTimes: List[int]) -> int:
        def get_max_x(m):
            if m < 0:
                return 0
            low_x, high_x = 0, m
            while low_x <= high_x:
                mid_x = (low_x + high_x) // 2
                if mid_x * (mid_x + 1) <= m:
                    low_x = mid_x + 1
                else:
                    high_x = mid_x - 1
            return high_x

        max_worker_time = max(workerTimes)
        H = mountainHeight
        t_upper = max_worker_time * H * (H + 1) // 2
        low, high = 0, t_upper

        while low < high:
            mid = (low + high) // 2
            s = 2 * mid
            total_x = 0
            for c in workerTimes:
                m = s // c
                x = get_max_x(m)
                total_x += x
            if total_x >= H:
                high = mid
            else:
                low = mid + 1
        return low

