        vector<int> need(26, 0), have(26, 0);
        int required_chars = 0;
        int matched_chars = 0;  

        for (char c : word2) {
            if (need[c - 'a'] == 0) {
                required_chars++;
            }
            need[c - 'a']++;
        }

        int left = 0;
        long long total = 0;
        int N = word1.size();

        for (int right = 0; right < N; ++right) {
            int c = word1[right] - 'a';
            have[c]++;
            if (have[c] == need[c]) {
                matched_chars++;
            }

            while (left <= right && have[word1[left] - 'a'] > need[word1[left] - 'a']) {
                have[word1[left] - 'a']--;
                left++;
            }

