import "fmt"

func validSubstringCount(word1 string, word2 string) int64 {
    n := len(word1)

    b := make([]int, 26)
    for _, c := range word2 {
        b[c-'a']++
    }

    a := make([]int, 26) 
    var r int64 = 0      
    l := 0             

    for right := 0; right < n; right++ {
        a[word1[right]-'a']++

        for isWindowValid(a, b) {
            r += int64(n - right)
            a[word1[l]-'a']--
            l++
        }
    }

    return r
}

func isWindowValid(a []int, b []int) bool {
    for i := 0; i < 26; i++ {
        if b[i] > 0 && a[i] < b[i] {
            return false
        }
    }
    return true
}

